import { Form, Button } from "react-bootstrap";

function Collab() {
  const handleSubmit = (event) => {
    event.preventDefault();
    // handle form submission
  };

  return (
    <Form onSubmit={handleSubmit} clas>
      <Form.Group className="p-3" controlId="fullName">
        <Form.Label>Full Name:</Form.Label>
        <Form.Control type="text" placeholder="Enter your full name" required />
      </Form.Group>

      <Form.Group className="p-3" controlId="email">
        <Form.Label>Email:</Form.Label>
        <Form.Control type="email" placeholder="Enter your email" required />
      </Form.Group>

      <Form.Group className="p-3" controlId="message">
        <Form.Label>Message:</Form.Label>
        <Form.Control as="textarea" rows={5} placeholder="Enter your message" required />
      </Form.Group>

      <Button variant="primary" type="submit" className="mx-4">
        Submit
      </Button>
    </Form>
  );
}

export default Collab;
